import React from "react";
import notes from "../notes";

var addedNotes = notes.map(function(item) {
  return (
    <div>
      <h1>{item.title}</h1>
      <p>{item.content}</p>
    </div>
  )
})

console.log(addedNotes);

function Note() {
  notes.map
}

export default Note;
